import React from "react";
import { Header, Footer } from "../components/mollecules";
import products from "../data/products";
import { Cards } from "../components/atomes";

function Product() {
  return (
    <div>
      <Header.laptopHeader />
      <div className="w-full p-10 flex flex-row flex-wrap">
        {products.map((i) => {
          return (
            <div>
              <Cards.Produit
                bg={produitVinRouge}
                color={i.color}
                typeColor={i.typeColor}
                type={i.type}
                name={"Vin Rouge Corvo"}
                pays={"Italie"}
                oldPrice={"16.80€"}
                price={"13.80€"}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default Product;
